const BASE_PATH := 'res://addons/anima/animations/'
const DEFAULT_DURATION := 0.7


enum Visibility {
	IGNORE,
	HIDDEN_ONLY,
	TRANSPARENT_ONLY,
	HIDDEN_AND_TRANSPARENT
}

var _animations_list := []

func get_available_animations() -> Array:
	if _animations_list.size() == 0 or true:
		_animations_list = _get_animations_list()

	return _animations_list

#
# Animates a single node
#
# @param array sequence_data array of animation data:
#		{
#			node = the node to animate
#			animation = the animation to play
#			duration = duration in seconds
#			delay = delay in seconds,
#			loop = loop animation?
#			hide = tells if the node needs to be hidden before the animation starts (Default false)
#			completed = callback
#		}
func create_animation(animation_name: String, data: Dictionary) -> AnimationPlayer:
	var duration: float = _get_value(data, 'duration', DEFAULT_DURATION)
	var delay: float = _get_value(data, 'delay', 0.0)
	var animation_player := _get_anima_animation_player(data.node)

	if animation_player.has_animation(animation_name):
		var existing_animation := animation_player.get_animation(animation_name)

		if existing_animation.length == data.duration:
			return animation_player

	var animation = Animation.new()

	animation_player.remove_animation(animation_name)
	animation_player.stop()

	animation.set_length(data.duration + delay)
	animation_player.add_animation(animation_name, animation)

	_add_animation_to_animation_resource(
		animation,
		{
			animation = data.animation,
			node = data.node,
			duration = data.duration,
			delay = delay,
			loop = _get_value(data, 'loop', false),
			loop_delay = _get_value(data, 'loop_delay', 0.0),
			hide_strategy = _get_value(data, 'hide_strategy', Visibility.IGNORE),
			callback = _get_value(data, 'callback', null)
		}
	)

	return animation_player

func create(data: Dictionary) -> AnimaTweens:
	var animation := AnimaTweens.new()

	add_child(animation)

	animation.set_data(data)

	return animation

func animate(data: Dictionary) -> AnimaTweens:
	var animation := create(data)

	animation.play()

	return animation

