#
# Allows to specify the animations to be played in sequence.
#
# @param array sequence_data array of animation data:
#		{
#			node = the node to animate
#			animation = the animation to play
#			duration = duration in seconds
#			delay = delay in seconds,
#			loop = loop animation?
#			completed = callback
#		}
# @param hide_nodes_strategy set if the nodes needs to be hidden, make transparent or leave as they are
#
func create_sequence_animation(sequence_name: String, sequence_data: Array, hide_nodes_strategy: int = Visibility.IGNORE) -> AnimationPlayer:
	var animation_player := _add_multiple_animations(sequence_name, sequence_data, hide_nodes_strategy, 1)

	animation_player.connect("animation_started", self, '_on_animation_started', [ sequence_data ])

	return animation_player

func sequence(sequence_data: Array, hide_nodes_strategy: int = Visibility.IGNORE) -> AnimationPlayer:
	if sequence_data.size() == 0:
		printerr("no sequence animation defined")

		return null

	var first_sequance = sequence_data[0]
	var sequence_name = first_sequance.node.name + first_sequance.animation + '.sequence'
	var animation_player := create_sequence_animation(sequence_name, sequence_data, hide_nodes_strategy)

	animation_player.play(sequence_name)

	return animation_player

#
# Allows to specify the animations to be played in parallel.
#
# @param array sequence_data array of animation data:
#		{
#			node = the node to animate
#			animation = the animation to play
#			duration = duration in seconds
#			delay = delay in seconds,
#			loop = loop animation?
#			completed = callback
#		}
# @param hide_nodes if true the node is automatically when its animation is not "playing"
#
func create_parallel_animation(sequence_name: String, sequence_data: Array, hide_nodes_strategy: int = Visibility.IGNORE) -> AnimationPlayer:
	return _add_multiple_animations(sequence_name, sequence_data, hide_nodes_strategy, 0)

func parallel(sequence_data: Array, hide_nodes_strategy: int = Visibility.IGNORE) -> AnimationPlayer:
	if sequence_data.size() == 0:
		printerr("no sequence animation defined")

		return null

	var first_sequance = sequence_data[0]
	var sequence_name = first_sequance.node.name + first_sequance.animation + '.sequence'
	var animation_player := create_parallel_animation(sequence_name, sequence_data, hide_nodes_strategy)

	animation_player.play(sequence_name)

	return animation_player

#
# Allows to easily animate a specific attribute
#
# @param data = {
#	node = node to animate
# attribute = attribute to animate, i.g.: modulate, offset,
#	from = initial value,
#	to = final value,
#	easing = not used yet,
#	duration = animation duration,
#	delay = animation delay,
#	pivot = the node pivot,
#	reset: bool = reset initial position
# }
func create_attribute_animation(animation_name: String, data: Dictionary) -> AnimationPlayer:
	var animation_player := _get_anima_animation_player(data.node)
	var animation := generate_attribute_animation(animation_name, data)

	animation_player.add_animation(animation_name, animation)
	animation_player.set_assigned_animation(animation_name)

	return animation_player

func generate_attribute_animation(animation_name: String, data: Dictionary) -> Animation:
	var animation := Animation.new()
	var track_index = animation.add_track(Animation.TYPE_VALUE)

	var node: CanvasItem = data.node
	var node_path := str(node.get_path())
	var duration: float = _get_value(data, 'duration', DEFAULT_DURATION)
	var delay: float = _get_value(data, 'delay', 0.0)
	var hide_strategy: int = _get_value(data, 'hide_strategy', Visibility.IGNORE)
	var reset_original_value: bool = _get_value(data, 'reset', false)
	var track_path: String = node_path + ":" + data.attribute

	animation.track_set_path(track_index, track_path)

	if data.has('pivot'):
		AnimaNodesProperties.set_pivot(node, data.pivot)

	animation.track_insert_key(track_index, delay + 0.0, data.from)

	if reset_original_value:
		animation.track_insert_key(track_index, (delay + duration) * 0.5, data.to)
		animation.track_insert_key(track_index, delay + duration, data.from)
	else:
		animation.track_insert_key(track_index, delay + duration, data.to)

	_set_hide_strategy(node, animation, delay, hide_strategy)
	_setup_animation_params(animation, track_index, duration + delay, data)
	animation.set_meta('_anima_animation_name', animation_name)

	return animation

func animate_attribute(data: Dictionary) -> AnimationPlayer:
	var animation_name = data.node.name + "." + data.attribute
	var animation_player := create_attribute_animation(animation_name, data)

	animation_player.play(animation_name)

	return animation_player

#
# Animate the Control/Sprite position
#
# @param data = {
#	node = node to animate
#	from: Vector2 = (optional) the starting position. If not set the current position will be used
#	to: Vector2 = final position. If relative is set to true, this will indicates the difference in px from the current position
#	relative: bool = true means that the "to" param indicates the difference in px from the current position. Default false
#	reset_position: bool = if true will also animate the position back to the original one. Default false
#	hide_strategy: Visibility = the hide strategy to use. Default Visibility.IGNORE,
#	loop: bool = should the animation be looped
#	ease: Easing = the easing to apply
# }
#
#
func create_position_animation(animation_name, data: Dictionary) -> AnimationPlayer:
	return create_attribute_animation(animation_name, data)

func generate_position_animation(animation_name: String, data: Dictionary) -> Animation:
	var node = data.node
	if not data.has('from'):
		data.from = AnimaNodesProperties.get_position(node)

	if data.has('relative') and data.relative:
		data.to = data.from + data.to

	data.attribute = AnimaNodesProperties.get_offset_property(node)
	data.reset = _get_value(data, 'reset_position', false)

	return generate_attribute_animation(animation_name, data)

func _get_value(data: Dictionary, key: String, default):
	return data[key] if data.has(key) else default

func _get_anima_animation_player(node: CanvasItem) -> AnimationPlayer:
	for child in node.get_children():
		if child is AnimationPlayer and child.name.find("Anima") >= 0:
			return child

	var animation_player: AnimationPlayer = AnimationPlayer.new()
	animation_player.name = "AnimaTweenPlayer"

	node.add_child(animation_player)

	return animation_player

func _setup_animation_params(animation: Animation, track_id: int, length: float, data: Dictionary) -> void:
	var loop: bool = _get_value(data, 'loop', false)
	var loop_delay: float = _get_value(data, 'loop', 0.0)
	var clamp_animation: bool = _get_value(data, '_clamp_animation', false)

	animation.set_loop(loop)

	if loop and loop_delay > 0 or clamp_animation:
		animation.track_set_interpolation_loop_wrap(track_id, false)
		length += loop_delay
	else:
		animation.track_set_interpolation_loop_wrap(track_id, true)

	animation.length = length

#
# Creates/Update Animation
#
# @param animation_data = {
#	group = the animation group name.
#	node = the node to animate
#	animation = the Anima animation to use
#	duration = the duration in seconds (default = 0.7s)
#	delay = the animation delay (default = 0.s)
# }
#
# animation_name: String, node: CanvasItem, animation: String, duration_in_seconds: float = 0.7, delay_in_seconds: float = 0, loop: bool = false
# 
func _add_animation_to_animation_resource(animation_resource: Animation, animation_data: Dictionary) -> void:
	var node_path = animation_data.node.get_path()

	var script_file = _get_full_script_path(animation_data.animation)

	if script_file == '':
		printerr('No animation found with name %s' % [animation_data.animation])

		return

	var hide_strategy: int = _get_value(animation_data, 'hide_strategy', Visibility.IGNORE)

	_generate_animation({
		animation_resource = animation_resource,
		script = script_file, 
		node = animation_data.node,
		duration = animation_data.duration,
		delay = animation_data.delay,
		hide_strategy = hide_strategy,
		completed = _get_value(animation_data, 'completed', null)
	})

#
# Invoke the script tha generates the animation and return the Animation node
#
# @param data {
# 	script = the full script path to load
#	node = the node to animate
#	duration = duration in seconds
#	delay = delay in seconds
#	hide = should the element be hidden before starting the animation? Default is true if delay time is bigger than 0
#
func _generate_animation(data: Dictionary) -> Animation:
	var animation_script = load(data.script).new()
	var animation: Animation = data.animation_resource
	var node: CanvasItem = data.node
	var duration: float = data.duration
	var delay: float = _get_value(data, 'delay', 0.0)
	var hide_strategy: int = _get_value(data, 'hide_strategy', Visibility.IGNORE)

	var real_duration = animation_script.generate_animation(animation, data.node, duration, delay)
	var node_path = str(node.get_path())

	_set_hide_strategy(node, animation, delay, hide_strategy)

	if real_duration is float and real_duration > 0:
		duration = real_duration

	if data.has('completed') and data.completed != null:
		var timer := _get_anima_timer(node)
		timer.one_shot = true
		timer.wait_time = delay + duration

		var is_already_connected := timer.is_connected("timeout", self, '_on_timer_timeout')
		if is_already_connected:
			timer.disconnect("timeout", self, '_on_timer_timeout')

		timer.connect("timeout", self, '_on_timer_timeout', data.completed)

	animation.set_length(duration + delay)

	return animation

func _set_hide_strategy(node: CanvasItem, animation: Animation, delay: float, hide_strategy: int) -> void:
	var node_path = str(node.get_path())

	# Animating the "visible" property causes a glitch, were you can see, for a fraction,
	# the node to be rendered in is original state before carrying on with the animation.
	# To avoid this we hide it makeing it transparent
	if hide_strategy == Visibility.TRANSPARENT_ONLY or hide_strategy == Visibility.HIDDEN_AND_TRANSPARENT:
		var can_set_modulate = not _is_node_animation_opacity(node, animation)

		var modulate = node.modulate
		var transparent = modulate
		transparent.a = 0

		var modulate_track_index = animation.add_track(Animation.TYPE_VALUE)

		animation.track_set_path(modulate_track_index, node_path + ":modulate")
		if can_set_modulate:
			animation.track_insert_key(modulate_track_index, 0, transparent)
			animation.track_insert_key(modulate_track_index, delay, transparent)
			animation.track_insert_key(modulate_track_index, delay + 0.01, modulate)

		_make_node_transparent(node)

	if hide_strategy == Visibility.HIDDEN_ONLY or hide_strategy == Visibility.HIDDEN_AND_TRANSPARENT:
		var visibility_track_index = animation.add_track(Animation.TYPE_VALUE)

		animation.track_set_path(visibility_track_index, node_path + ":visible")
		animation.track_insert_key(visibility_track_index, 0, false)
		animation.track_insert_key(visibility_track_index, delay - 0.01, true)

		node.hide()

#
# If any of the animation is changing the :modulate property
# we don't have to make the component visibile inside the modulate_track_index
func _is_node_animation_opacity(node: CanvasItem, animation: Animation) -> bool:
	var track_count = animation.get_track_count()
	var path = str(node.get_path())

	for track_index in track_count:
		var track_path: String = str(animation.track_get_path(track_index))

		if track_path.begins_with(path) and track_path.ends_with(':modulate'):
			return true

	return false

func _make_node_transparent(node) -> void:
	var modulate = node.modulate
	var transparent = modulate

	transparent.a = 0

	node.modulate = transparent

func _get_anima_timer(node: CanvasItem) -> Timer:
	var children = node.get_children()

	for child in children:
		if child is Timer and child.name.begins_with('AnimaTimer'):
			return child

	var timer = Timer.new()
	timer.name = 'AnimaTimer'

	node.add_child(timer)

	return timer

func _add_multiple_animations(sequence_name: String, animations: Array, hide_nodes_strategy: int, delay_multiplier: int = 1) -> AnimationPlayer:
	var next_delay := 0.0
	var total_duration := 0.0
	var first_node: CanvasItem
	var first_player: AnimationPlayer
	var should_copy_animation := false

	var animation = Animation.new()
	var index := 0
	for data in animations:
		if data is Animation:
			var node_path = str(data.track_get_path(0)).split(':')[0]
			var node = get_node(node_path)

			if not first_player:
				first_player = _get_anima_animation_player(node)

			_copy_and_transpose_animation_track(data, animation, total_duration * delay_multiplier)
		else:
			if not first_player:
				first_node = animations[0].node
				first_player = _get_anima_animation_player(first_node)

				if first_player.has_animation(sequence_name):
					first_player.remove_animation(sequence_name)

			var duration = _get_value(data, 'duration', DEFAULT_DURATION)
			var delay = _get_value(data, 'delay', 0.0)
			var hide_strategy = _get_value(data, 'hide_strategy', Visibility.IGNORE)
			var completed = _get_value(data, 'completed', null)

			_add_animation_to_animation_resource(
				animation,
				{
					node = data.node,
					animation = data.animation,
					duration = duration,
					delay = delay + next_delay,
					hide_strategy = hide_nodes_strategy,
					completed = completed
				}
			)

		next_delay = animation.length * delay_multiplier
		total_duration += animation.length
		index += 1

	animation.length = total_duration

	if first_player:
		first_player.add_animation(sequence_name, animation)
		first_player.set_assigned_animation(sequence_name)

		return first_player

	printerr('The animations data contains no node!')

	return AnimationPlayer.new()

func _get_animations_list() -> Array:
	var files = _get_scripts_in_dir(BASE_PATH)

	files.sort()
	return files

func _copy_and_transpose_animation_track(source: Animation, dest: Animation, offset: float) -> void:
	var animation_name: String = source.get_meta('_anima_animation_name')

	for track_index in range(0, source.get_track_count()):
		source.copy_track(track_index, dest)

		var new_track_index = dest.get_track_count() - 1
		var track_type := source.track_get_type(new_track_index)

		for key_index in range(0, dest.track_get_key_count(new_track_index)):
			var original_key_time := dest.track_get_key_time(track_index, key_index)
			var new_key_time := original_key_time + offset

			if original_key_time != new_key_time:
				dest.track_set_key_time(track_index, key_index, new_key_time)

func _get_scripts_in_dir(path: String, files: Array = []) -> Array:
	var dir = Directory.new()
	if dir.open(path) != OK:
		return files

	dir.list_dir_begin()
	var file_name = dir.get_next()

	while file_name != "":
		if file_name != "." and file_name != "..":
			if dir.current_is_dir():
				_get_scripts_in_dir(path + file_name + '/', files)
			else:
				files.push_back(path + file_name)

		file_name = dir.get_next()

	return files

func _get_full_script_path(animation_name: String) -> String:
	if not animation_name.ends_with('.gd'):
		animation_name += '.gd'

	animation_name = AnimaStrings.from_camel_to_snack_case(animation_name)

	for file_name in get_available_animations():
		if file_name.ends_with(animation_name):
			return file_name

	return ''

func _on_animation_started(name: String, data) -> void:
	for item in data:
		if item is Dictionary and item.has('completed') and item.completed:
			var timer := _get_anima_timer(item.node)

			timer.stop()
			timer.start()

func _on_timer_timeout(func_ref: FuncRef, parameter) -> void:
	func_ref.call_funcv(parameter)

